def auptod(maxdigits):
  alst = [0]
  for k in range(1, maxdigits+1):
    aklst = []
    for d1 in range(1, 10):
      d = [(d1*i)%10 for i in range(k, 0, -1)]
      if d[0] != 0: aklst.append(int("".join(map(str, d))))
    alst.extend(sorted(aklst))
  return alst
